DELIMITER $$
--
-- Procedimientos
--
DROP PROCEDURE IF EXISTS `generar_datos_ecuador`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `generar_datos_ecuador` ()   BEGIN
    DECLARE i INT DEFAULT 0;
    DECLARE rand_prov INT;
    DECLARE rand_prod INT;
    DECLARE rand_cant INT;
    DECLARE rand_costo DECIMAL(10,2);
    DECLARE rand_precio_venta DECIMAL(10,2);
    DECLARE last_compra_id INT;
    DECLARE last_lote_id INT;
    DECLARE max_lotes INT;
    
    -- ==========================================
    -- A. GENERAR 150 COMPRAS (CORREGIDO)
    -- ==========================================
    SET i = 0;
    WHILE i < 150 DO
        SET rand_prov = FLOOR(1 + (RAND() * 5)); 
        
        -- 1. Creamos la cabecera con total 0 (temporalmente)
        VALUES (rand_prov, DATE_SUB(NOW(), INTERVAL FLOOR(RAND() * 365) DAY), 
                CONCAT('001-001-', LPAD(FLOOR(RAND()*999999), 9, '0')), 0);
        
        SET last_compra_id = LAST_INSERT_ID();
        
        -- 2. Insertamos el detalle (Productos)
        SET rand_prod = FLOOR(1 + (RAND() * 20)); 
        SET rand_cant = FLOOR(20 + (RAND() * 80)); 
        
        SELECT precio_venta INTO rand_precio_venta FROM productos WHERE id_producto = rand_prod;
        SET rand_costo = rand_precio_venta * (0.6 + (RAND() * 0.1));
        
        VALUES (last_compra_id, rand_prod, rand_cant, rand_costo, 
                CONCAT('L-', FLOOR(1000 + RAND()*9000)), 
                DATE_ADD(NOW(), INTERVAL FLOOR(RAND() * 600) - 50 DAY)); 
        
        -- 3. !!! AQUÍ ESTÁ EL ARREGLO !!!
        -- Calculamos el total de ESTA compra específica y lo actualizamos
        UPDATE compras 
        SET total = (SELECT SUM(cantidad * costo_unitario) FROM detalle_compras WHERE id_compra = last_compra_id)
        WHERE id_compra = last_compra_id;
        
        SET i = i + 1;
    END WHILE;

    -- ==========================================
    -- B. GENERAR 1200 VENTAS (YA ESTABA BIEN)
    -- ==========================================
    SET i = 0;
    SELECT MAX(id_lote) INTO max_lotes FROM lotes;
    
    WHILE i < 1200 DO
        VALUES (FLOOR(1 + RAND() * 4), 
                'Consumidor Final', 
                DATE_SUB(NOW(), INTERVAL FLOOR(RAND() * 365) DAY), 0);
        
        SET last_lote_id = FLOOR(1 + (RAND() * max_lotes));
        
        IF last_lote_id IS NOT NULL THEN
             SELECT id_producto INTO rand_prod FROM lotes WHERE id_lote = last_lote_id LIMIT 1;
             
             IF rand_prod IS NOT NULL THEN
                SELECT precio_venta INTO rand_precio_venta FROM productos WHERE id_producto = rand_prod;
                
                VALUES (LAST_INSERT_ID(), rand_prod, last_lote_id, 
                        FLOOR(1 + RAND() * 3), 
                        rand_precio_venta, 
                        0);
                
                UPDATE detalle_ventas SET subtotal = cantidad * precio_unitario WHERE id_venta = LAST_INSERT_ID();
                UPDATE ventas SET total = (SELECT SUM(subtotal) FROM detalle_ventas WHERE id_venta = LAST_INSERT_ID()) WHERE id_venta = LAST_INSERT_ID();
             END IF;
        END IF;

        SET i = i + 1;
    END WHILE;

END$$

